INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, "2020/07/31 12:00:00", 0.0, 0.0, 102301, 2, 2, 24001, 0.0, "アヤネ", 24, 401, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", "2030/12/17 14:59:59");
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, "2020/07/31 12:00:00", 0.0, 2.21, 102301, 1, 2, 24002, 0.0, "アヤネ", 24, 402, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", "2030/12/17 14:59:59");
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, "2020/07/31 12:00:00", 0.0, 0.0, 102301, 2, 2, 24003, 0.0, "アヤネ", 24, 403, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", "2030/12/17 14:59:59");
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, "2020/07/31 12:00:00", 0.0, 1.99, 192201, 2, 1, 24004, 0.0, "アサヒ", 24, 701, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", "2030/12/17 14:59:59");
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, "2020/07/31 12:00:00", 0.0, 2.21, 192201, 1, 2, 24005, 0.0, "アサヒ", 24, 702, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", "2030/12/17 14:59:59");
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, "2020/07/31 12:00:00", 0.0, 3.33, 192201, 2, 1, 24006, 0.0, "アサヒ", 24, 703, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", "2030/12/17 14:59:59");
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, "2020/07/31 12:00:00", 0.0, 0.0, 192301, 2, 2, 24007, 0.0, "部員３", 24, 801, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", "2030/12/17 14:59:59");
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, "2020/07/31 12:00:00", 0.0, 2.68, 192301, 1, 2, 24008, 0.0, "部員３", 24, 802, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", "2030/12/17 14:59:59");
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, "2020/07/31 12:00:00", 0.0, 0.0, 192301, 2, 2, 24009, 0.0, "部員３", 24, 803, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", "2030/12/17 14:59:59");
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, "2020/07/31 12:00:00", 0.0, 0.0, 192501, 1, 1, 24010, 0.0, "", 24, 501, "やった！", "2030/12/17 14:59:59");
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, "2020/07/31 12:00:00", 0.0, 0.0, 192501, 1, 1, 24011, 0.0, "", 24, 502, "勝ったよ！", "2030/12/17 14:59:59");
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, "2020/07/31 12:00:00", 0.0, 0.0, 192501, 1, 1, 24012, 0.0, "", 24, 503, "いい調子！", "2030/12/17 14:59:59");
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, "2020/07/31 12:00:00", 0.0, 5.33, 113501, 6, 2, 24013, 0.0, "ミサト", 24, 111, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", "2030/12/17 14:59:59");
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, "2020/07/31 12:00:00", 0.0, 6.85, 113501, 1, 2, 24014, 0.0, "ミサト", 24, 112, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", "2030/12/17 14:59:59");
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, "2020/07/31 12:00:00", 0.0, 3.0, 113501, 1, 2, 24015, 0.0, "ミサト", 24, 113, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", "2030/12/17 14:59:59");
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, "2020/07/31 12:00:00", 0.0, 6.11, 192401, 1, 2, 24016, 0.0, "ダイチ", 24, 611, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", "2030/12/17 14:59:59");
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, "2020/07/31 12:00:00", 0.0, 6.75, 192401, 1, 2, 24017, 0.0, "ダイチ", 24, 612, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", "2030/12/17 14:59:59");
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, "2020/07/31 12:00:00", 0.0, 0.0, 192401, 2, 2, 24018, 0.0, "ダイチ", 24, 613, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", "2030/12/17 14:59:59");
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, "2020/07/31 12:00:00", 0.0, 4.52, 113401, 2, 1, 24019, 0.0, "ハツネ", 24, 211, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", "2030/12/17 14:59:59");
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, "2020/07/31 12:00:00", 0.0, 3.89, 113401, 2, 1, 24020, 0.0, "ハツネ", 24, 212, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", "2030/12/17 14:59:59");
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, "2020/07/31 12:00:00", 0.0, 13.49, 113401, 1, 2, 24021, 0.0, "ハツネ", 24, 213, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", "2030/12/17 14:59:59");
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, "2020/07/31 12:00:00", 0.0, 3.17, 106501, 1, 2, 24022, 0.0, "カヤ", 24, 311, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", "2030/12/17 14:59:59");
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, "2020/07/31 12:00:00", 0.0, 4.42, 106501, 1, 2, 24023, 0.0, "カヤ", 24, 312, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", "2030/12/17 14:59:59");
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, "2020/07/31 12:00:00", 0.0, 2.89, 106501, 6, 1, 24024, 0.0, "カヤ", 24, 313, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", "2030/12/17 14:59:59");
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, "2020/07/31 12:00:00", 0.0, 3.71, 102301, 4, 3, 24025, 0.0, "アヤネ", 24, 421, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", "2030/12/17 14:59:59");
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, "2020/07/31 12:00:00", 0.0, 5.1, 192201, 2, 1, 24026, 0.0, "アサヒ", 24, 721, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", "2030/12/17 14:59:59");
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, "2020/07/31 12:00:00", 0.0, 4.34, 192301, 1, 3, 24027, 0.0, "部員３", 24, 821, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", "2030/12/17 14:59:59");
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, "2020/07/31 12:00:00", 0.0, 0.0, 192501, 1, 1, 24028, 0.0, "", 24, 521, "いい勝負だったよ\nまたやろうね", "2030/12/17 14:59:59");
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, "2020/07/31 12:00:00", -360.0, 5.62, 113501, 1, 2, 24029, 0.0, "ミサト", 24, 101, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", "2030/12/17 14:59:59");
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, "2020/07/31 12:00:00", -360.0, 9.58, 113501, 1, 2, 24030, 0.0, "ミサト", 24, 102, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", "2030/12/17 14:59:59");
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, "2020/07/31 12:00:00", -360.0, 0.0, 113501, 2, 2, 24031, 0.0, "ミサト", 24, 103, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", "2030/12/17 14:59:59");
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, "2020/07/31 12:00:00", -360.0, 9.13, 113501, 2, 1, 24032, 0.0, "ミサト", 24, 104, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", "2030/12/17 14:59:59");
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (10046, "2020/07/31 12:00:00", -360.0, 8.27, 113501, 1, 2, 24033, 0.0, "ミサト", 24, 105, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", "2030/12/17 14:59:59");
